def writeSplits(type, spl):
  lines = [type + ' ' + ' '.join(v) + '\n' for v in spl]
  f.writelines(lines)
  #for v in spl:
  #  print(type + ' ' + ' '.join(v))

def split(a, n):
  return [a[i:i+n] for i in range(0, len(a), n)]

def writeVertices(type, n, a):
  a = [str(f) for f in a]
  writeSplits(type, split(a, n))

def writeFaces(a, has_vt, has_vn):
  def fmerge(f):
    f = str(f+1)
    if has_vt and has_vn:
      return f+'/'+f+'/'+f
    elif has_vt:
      return f+'/'+f
    elif has_vn:
      return f+'//'+f
    else:
      return f
  a = [fmerge(f) for f in a]
  writeSplits('f', split(a, 3))

def writeMesh(mesh):
  for type, a in mesh.iteritems():
    vertex_ns = { 'v': 3, 'vn': 3, 'vt': 2 }
    if type in vertex_ns:
      writeVertices(type, vertex_ns[type], a)
    elif type == 'f':
      writeFaces(a, 'vt' in mesh, 'vn' in mesh)

def mesh2Obj(fn, mesh):
  global f
  f = open(fn, 'w')
  f.write('g all\ns 1\n')
  writeMesh(mesh)
  f.close()

def weld(v1, v2, thresh):
  for i in range(0, len(v1), 3):
    r2min = thresh
    jmin = -1
    for j in range(0, len(v2), 3):
      d = [v2[j+k] - v1[i+k] for k in range(3)]
      r2 = sum(v*v for v in d)
      if r2 < thresh and r2 < r2min:
        r2min = r2
        jmin = j
    if jmin != -1:
      for k in range(3):
        avg = (v1[i+k] + v2[jmin+k]) / 2.0
        v1[i+k] = v2[jmin+k] = avg

weld(screen_mesh['v'], rim_mesh['v'], 0.001)
mesh2Obj('screen.obj', screen_mesh)
mesh2Obj('rim.obj', rim_mesh)
